import "../assets/scss/Work.scss";
import Carousel from "react-bootstrap/Carousel";
import expenses1 from "../assets/images/expenses_1.png";
import expenses2 from "../assets/images/expenses_2.png";
import expenses3 from "../assets/images/expenses_3.png";
import FadeInSection from "./FadeInSection";
function Work() {
    return (
        <FadeInSection>
            <div className="work">
                <Carousel>
                    <Carousel.Item>
                        <img
                            className="d-block w-100"
                            src={expenses1}
                            alt="First slide"
                        />
                    </Carousel.Item>
                    <Carousel.Item>
                        <img
                            className="d-block w-100"
                            src={expenses2}
                            alt="Second slide"
                        />
                    </Carousel.Item>
                    <Carousel.Item>
                        <img
                            className="d-block w-100"
                            src={expenses3}
                            alt="Third slide"
                        />
                    </Carousel.Item>
                </Carousel>
            </div>
        </FadeInSection>
    );
}
export default Work;
